/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<div class="${classMap(context.classes.root)}" dir="${ifDefined(context.effectiveDir)}">${ context.tabsAtTheBottom ? block1(context, tags, suffix) : undefined }<div class="${classMap(context.classes.header)}" id="${ifDefined(context._id)}-header"><div class="ui5-tc__overflow ui5-tc__overflow--start" @click="${context._onOverflowClick}" @keydown="${context._onOverflowKeyDown}" hidden>${ context.startOverflowButton.length ? block4(context, tags, suffix) : block5(context, tags, suffix) }</div><div id="${ifDefined(context._id)}-tabStrip" class="${classMap(context.classes.tabStrip)}" role="tablist" @click="${context._onTabStripClick}" @keydown="${context._onTabStripKeyDown}" @keyup="${context._onTabStripKeyUp}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block6(item, index, context, tags, suffix)) }</div><div class="ui5-tc__overflow ui5-tc__overflow--end" @click="${context._onOverflowClick}" @keydown="${context._onOverflowKeyDown}" hidden>${ context.overflowButton.length ? block7(context, tags, suffix) : block8(context, tags, suffix) }</div></div>${ !context.tabsAtTheBottom ? block9(context, tags, suffix) : undefined }</div> `;
const block1 = (context, tags, suffix) => html`<div class="${classMap(context.classes.content)}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block2(item, index, context, tags, suffix)) }</div>`;
const block2 = (item, index, context, tags, suffix) => html`${ !item.isSeparator ? block3(item, index, context, tags, suffix) : undefined }`;
const block3 = (item, index, context, tags, suffix) => html`<div class="ui5-tc__contentItem" id="ui5-tc-contentItem-${ifDefined(item._posinset)}" ?hidden="${item.effectiveHidden}" role="tabpanel" aria-labelledby="${ifDefined(item._id)}"><slot name="${ifDefined(item._individualSlot)}"></slot></div>`;
const block4 = (context, tags, suffix) => html`<slot name="startOverflowButton"></slot>`;
const block5 = (context, tags, suffix) => html`<${scopeTag("ui5-button", tags, suffix)} icon="${ifDefined(context.overflowMenuIcon)}" data-ui5-stable="overflow-start" tabindex="-1" title="${ifDefined(context.overflowMenuTitle)}" aria-haspopup="true" icon-end>${ifDefined(context._startOverflowText)}</${scopeTag("ui5-button", tags, suffix)}>`;
const block6 = (item, index, context, tags, suffix) => html`${ifDefined(item.stripPresentation)}`;
const block7 = (context, tags, suffix) => html`<slot name="overflowButton"></slot>`;
const block8 = (context, tags, suffix) => html`<${scopeTag("ui5-button", tags, suffix)} icon="${ifDefined(context.overflowMenuIcon)}" data-ui5-stable="overflow-end" tabindex="-1" title="${ifDefined(context.overflowMenuTitle)}" aria-haspopup="true" icon-end>${ifDefined(context._endOverflowText)}</${scopeTag("ui5-button", tags, suffix)}>`;
const block9 = (context, tags, suffix) => html`<div class="${classMap(context.classes.content)}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block10(item, index, context, tags, suffix)) }</div>`;
const block10 = (item, index, context, tags, suffix) => html`${ !item.isSeparator ? block11(item, index, context, tags, suffix) : undefined }`;
const block11 = (item, index, context, tags, suffix) => html`<div class="ui5-tc__contentItem" id="ui5-tc-contentItem-${ifDefined(item._posinset)}" ?hidden="${item.effectiveHidden}" role="tabpanel" aria-labelledby="${ifDefined(item._id)}"><slot name="${ifDefined(item._individualSlot)}"></slot></div>`;


export default block0;
